namespace PletkaRedka.Data.Seeding
{
    using System;
    using System.Collections.Generic;
    using System.Linq;
    using System.Threading.Tasks;

    using PletkaRedka.Data.Models;

    public class CategoriesSeeder : ISeeder
    {
        public async Task SeedAsync(ApplicationDbContext dbContext, IServiceProvider serviceProvider)
        {
            if (dbContext.Categories.Any())
            {
                return;
            }

            var categories = new List<(string Name, string ImageUrl)>
            {
                ( "TypesOfKnitting", "https://3.bp.blogspot.com/-v_3crPB6PYM/U_ii8N1hgWI/AAAAAAAAPhg/LFPp2FZeYhU/s1600/PicMonkey%2BRibbings.jpg"),
                ( "VideoTutorials", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8ApDmbYmodbnaFb0mF7HG4cJc_9jIrMdC_A&usqp=CAU"),
                ( "Schemes", "https://ibazar.focus.bg/photosbazar/79/original/79f3929f4aea3b42faf5f611aa8eafd9.jpg"),
                ( "Flowers", "data:image/jpeg;base64,"),
                ( "KnittedJewelry", "data:image/jpeg;base64,"),
                ( "KnittedToys", "https://bissiart.com/wp-content/uploads/2017/06/monkey.jpg"),
                ( "KnittingWithBeads", "https://anika99.com/image/cache/data/Podaraci/Topki_S_manista/topka_6_11-1500x1100.jpg"),
            };

            foreach (var item in categories)
            {
                await dbContext.AddAsync(new Category
                {
                    Name = item.Name,
                    Description = item.Name,
                    ImageUrl = item.ImageUrl,
                });
            }
        }
    }
}
